    class math:
        def addint(int_num1,int_num2):
            cnum1 = int(int_num1)
            cnum2 = int(int_num2)
            return cnum1+cnum2
        def subint(int_num1,int_num2):
            cnum1 = int(int_num1)
            cnum2 = int(int_num2)
            return cnum1-cnum2
        def divint(int_num1,int_num2):
            cnum1 = int(int_num1)
            cnum2 = int(int_num2)
            return cnum1/cnum2
        def mulint(int_num1,int_num2):
            cnum1 = int(int_num1)
            cnum2 = int(int_num2)
            return cnum1*cnum2
        # float nums
